澳仔角今屬蘇澳鎮港邊里，位在蘇澳鎮東北邊，因位處海邊，居民大多以漁業為生，港邊里有兩大聚落，分別為港口及嶺腳，皆為漁村聚落。澳仔角位於岳明新村東南方海邊，七星嶺北坡嶺下海濱地區，昔日新城溪舊道出海口，後因淹塞成現今無尾港，而上方有七星嶺阻隔，形成一處灣澳岬角，因此稱為澳仔角。澳仔角因地處偏僻，昔日人煙罕至，保有潔淨的潮間帶與奇陵怪石，當地人經常在此採集海菜，在海石岩壁採挖貝類，但因環境變遷及海岸線侵蝕嚴重，官方以消波塊堆疊在海岸線上，使得昔日美景不再。穿過澳仔角南邊岬角處，便是北方澳，北方澳現在為海軍中正基地。

